import Link from 'next/link';
import {A} from './styles';
  
const Header = () => (
  <div>
    <Link href="/">
      <A>Latest posts</A>
    </Link>
    <Link href="/new">
      <a style={linkStyle}>New post</a>
    </Link>
  </div>
);
  
export default Header;
